      <div className="text-center px-6">
        <h1 className="text-5xl md:text-6xl font-extrabold mb-4">Vault5</h1>
        <p className="text-xl md:text-2xl mb-8">Financial Freedom. Discipline. Automation.</p>
        <div className="space-x-4">
          <button
            onClick={() => navigate('/register')}
            className="px-6 py-3 bg-white text-blue-700 rounded-lg font-semibold hover:bg-gray-100"
          >
            Get Started
          </button>
          <button
            onClick={() => navigate('/login')}
            className="px-6 py-3 border border-white text-white rounded-lg font-semibold hover:bg-white hover:text-blue-700"
          >
            Login
          </button>
        </div>
        <p className="mt-6 opacity-90">Track, Allocate, Enforce, Invest â€” All in one place.</p>
      </div>
    </div>
  );
};

export default Landing;
